Component({
    methods: {
        onButtonTap: function () {
            var onButtonTap = this.props.onButtonTap;
            if (typeof onButtonTap === 'function') {
                return onButtonTap();
            }
        },
        onHideTips: function () {
            var onHideTips = this.props.onHideTips;
            if (typeof onHideTips === 'function') {
                return onHideTips(false);
            }
        },
    },
});